import { useState,  useEffect} from 'react'
import './App.css'
import axios from 'axios'

const App = () => {
  useEffect(() => {
    console.log('effect')
    axios
      .get('http://localhost:3001/notes')
      .then(response => {
        console.log('promise fulfilled')
        console.log(response.data)
        setNotes(response.data)
      })
  }, [])

  const [notes, setNotes] = useState([
    { serialNumber:'', snapshotTimestamp:'', closestDistance: 0, owner: '', ownerEmail: '' , phone:''}
  ]) 

  const showNotes = notes.map(note=> {
                                          return(<div>
                                            <div key = "owner">Owner: {note.owner}</div >
                                            <div key = "phone">Phone: {note.phone}</div>
                                            <div key = "email">Email: {note.ownerEmail}</div>
                                            <div key = "serialNumber">serialNumber: {note.serialNumber}</div>
                                            <div key ="snapshotTimestamp">Last time: {note.snapshotTimestamp}</div>
                                            <div key = "closestDistance">closestDistance: {note.closestDistance}</div></div>)})



  return (
    <div>
      <h2>The pilots who recently violated the NDZ perimeter.</h2>
      <>
      <div>{showNotes}</div>
      </>
    </div>

  )
}
export default App
